import { StyleSheet } from "react-native";

const styles = StyleSheet.create({
  container: {
    flex: 1,
    justifyContent: "center",
    alignItems: "center",
    marginHorizontal: 20,
  },
  text_white: {
    color: "#FFF",
  },
  text_primary: {
    color: "#3483fa",
  },
  input: {
    width: "100%",
    borderBottomWidth: 1,
    borderBottomColor: "#c4c4c4",
    marginTop: 40,
  },
  containerInput: {
    width: "100%",
    marginBottom: 40,
  },
  redefinePass: {
    marginTop: 40,
  },
  buttonBack: {
    position: "absolute",
    top: 60,
    left: 20,
    color: "#3483FA",
  },
});

export default styles;
